DataAdapter.prototype.post = function(url, data){
	var _this = this;
	/** exiSAXS could be not defined yed **/
	if (EXI != null){
		EXI.setLoading();
	}
	var connections = EXI.credentialManager.getConnections();
	 url = this.getUrl(connections[0], url);
	 $.ajax({
		  type: "POST",
		  url: url,
		  data: data,
		  success: function(data){ 
			  _this.onSuccess.notify(data);
			  if (EXI != null){
				  EXI.setLoading(false);
			  }
		  },
		  error: function(error){
			  _this.onError.notify(error);
			  if (EXI != null){
				  EXI.setError(error);
			  }
		  }
	});
	 
};


/** Function for String **/
String.prototype.format = function (args) {
	var str = this;
	return str.replace(String.prototype.format.regex, function(item) {
		var intVal = parseInt(item.substring(1, item.length - 1));
		var replace;
		if (intVal >= 0) {
			replace = args[intVal];
		} else if (intVal === -1) {
			replace = "{";
		} else if (intVal === -2) {
			replace = "}";
		} else {
			replace = "";
		}
		return replace;
	});
};
String.prototype.format.regex = new RegExp("{-?[0-9]+}", "g");

